import './Index.css'
import React from 'react'
import PortfolioUm from './PortfolioUm'
import PortfolioDois from './PortfolioDois'

export default function Portfolio(){

    const backPortfolio = () =>{
        let port = document.getElementById('portfolioDois')
        port.style.display = 'none'
    }

    const nextPortfolio = () =>{
        let port = document.getElementById('portfolio-2')
        port.style.display = 'none'
    }

    return(
        <section id='portfolio' className='portfolio'>

            <div className='arrow-to-left'onClick={()=>backPortfolio()}><h1>&lt;</h1></div>

            <div id='PortfolioUm'><PortfolioUm/></div>

            <div id='PortfolioDois'><PortfolioDois id='PortfolioDois'/></div>

            <div className='arrow-to-right' onClick={()=>nextPortfolio()}><h1>&gt;</h1></div>
        </section>
    )
}
